import React from "react";
import "./App.css";
import Sidebar from "./components/sidebar/Sidebar";
import Home from "./components/home/Home";
import About from "./components/about/About";
import NavBar from "./components/navbar/NavBar";

function App() {
  return (
    <>
      <Sidebar />
      <NavBar />
      <main className="main">
        <Home id="/" />
        <About id="about" />
      </main>
    </>
  );
}

export default App;
